const OptionsStyle = {
  body: {
    display: "block",
    backgroundColor: "red",
    width: "150px",
    height: "100px",
    position: "absolute",
    left: "31%",
    top: "63px",
    margin: 0,
  },
  ul: {
    listStyle: "none",
  },
};

export default OptionsStyle;
